INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Et et qui explicabo.', 'Est omnis saepe facere voluptate a. Optio laudantium eveniet ut aut dolores.', 'Ratione impedit quis non voluptas. Possimus itaque perspiciatis saepe.', '1992-08-07');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Numquam laudantium excepturi quis nihil.', 'Animi dignissimos rerum rerum quod. Minima vel repellendus fuga. Adipisci et numquam sit esse aliquam eaque vel. Aut deleniti ipsa quia placeat.', 'Nostrum accusantium natus quasi totam animi delectus qui. Debitis voluptatem animi ab vel.', '2008-03-13');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Alias rerum sit itaque et ducimus illum.', 'Tenetur saepe doloribus accusantium eveniet delectus similique minus. Ut est maxime aspernatur similique id vitae. Qui quis distinctio tempore quis laboriosam blanditiis. Dolor autem qui et nihil nam laudantium.', 'Aut consequuntur occaecati ad. Recusandae omnis nesciunt sapiente non qui dolores doloribus. Totam illum quibusdam aut nihil est.\nUt aut et sit laboriosam at aut. Voluptatem magni laborum itaque.', '1973-06-21');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (4, 4, 'Qui blanditiis tempore temporibus sit molestiae officia nesciunt et.', 'Odit et porro qui. Ad in vel eos autem ullam. Aut fugiat delectus nemo quia. Odio reprehenderit quo similique voluptas ipsam eum molestiae culpa.', 'Provident et temporibus fugit ut est aut. Est cumque aut id nemo. Vero unde sed aut maiores maxime expedita.', '1988-11-17');
